const handleClick = ({ clientX, clientY }) => {        
    virtualEl.value = {
        getBoundingClientRect:()=> {
            return {
                width: 0,
                height: 0,
                x: clientX,
                y: clientY,
                top: clientY,
                left: clientX,
                right: clientX,
                bottom: clientY,
            };
        },
        contextElement: unrefElement(virtualDomRef),
    };
}

